fn main() {
    assert_eq!(
        Solution::shortest_palindrome("aacecaaa".to_string()),
        "aaacecaaa".to_string()
    );
    assert_eq!(
        Solution::shortest_palindrome("abcd".to_string()),
        "dcbabcd".to_string()
    );

    assert_eq!(
        Solution::shortest_palindrome("".to_string()),
        "".to_string()
    );
}

pub struct Solution {}
// https://www.tutorialspoint.com/shortest-palindrome-in-cplusplus
impl Solution {
    pub fn shortest_palindrome(s: String) -> String {
        let rev = format!("{}#{}", s, s.chars().rev().collect::<String>());

        let mut lps = vec![0; rev.len()];
        let mut i = 1;
        let mut j = 0;
        while i < rev.len() {
            if rev.chars().nth(i) == rev.chars().nth(j) {
                lps[i] = j + 1;
                j += 1;
                i += 1;
            } else {
                if j > 0 {
                    j = lps[j - 1];
                } else {
                    i += 1;
                }
            }
        }

        return format!(
            "{}{}",
            &s[lps[lps.len() - 1]..].chars().rev().collect::<String>(),
            s
        );
    }
}
